import { Link } from "react-router-dom";


function ScoreList(props) {
    return (
        <div className="scoreList">
            <p>금{props.name}</p>
            <div className="score active"/>
            <div className="score"/>
            <div className="score"/>
            <div className="score"/>
            <div className="score"/>
            <Link to="/edit">편집하기</Link>
        </div>
    )
}

export default ScoreList;
